import React from 'react'
import Paper from '@material-ui/core/Paper';
import Grid from "@material-ui/core/Grid";
import { Button } from '@material-ui/core';

function  Paging (props)  {
    return (
        <div>
            <Grid
                container
                direction="row"
                spacing={1}
                alignItems="flex-start"
                style={{
                    // color: "#66b5ff",
                    color: "black",
                    width: "100%",
                    height: "100%",
                    flexGrow: 1
                }}
            >
                <Grid item >
                
                    <Button onClick={props.main.gotoHomePaging}
                    size='small' style={{backgroundColor: "#e6f2ff"}}><b style={{color: "#66b3ff"}}>{"<<"}</b></Button>
                </Grid>
                <Grid item>
                <Button onClick={props.main.goOneBackPaging}
                size='small' style={{backgroundColor: "#e6f2ff"}}><b style={{color: "#66b3ff"}}>{"<"}</b></Button>
                </Grid>
                <Grid item >Page </Grid>
                <Grid item >
                    <Paper style={{backgroundColor: "#e6f2ff"}}> {" "+props.main.state.pageNo+" "}</Paper> 
                </Grid>    
                <Grid item > of </Grid>
                <Grid item >
                    <Paper style={{backgroundColor: "#e6f2ff"}} size='medium'>{" "+props.main.state.totalPage+" "} </Paper>
                </Grid>
                <Grid item >
                <Button onClick={props.main.goOneNextPaging}
                size='small' style={{backgroundColor: "#e6f2ff"}}><b style={{color: "#66b3ff"}}>{">"}</b></Button>
                </Grid>
                <Grid item >
                <Button onClick={props.main.gotoEndPaging}
                size='small' style={{backgroundColor: "#e6f2ff"}}><b style={{color: "#66b3ff"}}>{">>"}</b></Button>
                </Grid>
                <Grid item sm={7}>
                    <Paper sm={7}></Paper>
                </Grid>
                <Grid item >
                    <Paper >Customers</Paper>
                </Grid>
            </Grid>
        </div>
    );
}

export default Paging;
